// src/pages/Evento.js
import React from 'react';
import Ticket from '../components/Ticket';

const Evento = () => {
  return (
    <div>
      <h1>Evento</h1>
      <Ticket
        ticketType="VIP"
        title="Concert 2024"
        name="John Doe"
        date="22-10-2024"
        address="123 Main St, Cityville"
        qrCode="https://example.com/qr-code.png" // Ruta a la imagen del QR
        id="1234567890"
      />
    </div>
  );
};

export default Evento;
